	<div class="content">
											При выборе игрушек для собак, многие руководствуются только внешним видом и ее размером, а думали ли вы насколько безопасен материал изделия?<br>
 Компания Doglike изготавливает игрушки для животных, материал изделия которых, проходит строгий контроль качества.<br>
<h2>Игрушки Doglike:</h2>
 <br>
<ul class="article-list">
	<li>не содержат вредных веществ;</li>
	<li>не имеют запаха;</li>
	<li>гипоаллергенные;</li>
	<li>используются в производстве детских игрушек;</li>
	<li>на поверхности игрушек не размножаются грибки и бактерии;</li>
	<li>игрушки не травмируют зубы и десна собаки;</li>
</ul>
 <br>
 Делая выбор в пользу Doglike, вы не только приобретаете удобную, легкую и высокопрочную игрушку для собаки, но и игрушку безопасную для здоровья животного.<br>						</div>






